import React, { Component } from 'react';
import "./Output.css";
class Output extends Component{
    constructor(props){
        super(props);
    }


    render(){
        return(
            <div className='Output'>
                <h1>Output</h1>
                <h2>{this.props.userName}</h2>
            </div>
        )
    }
}
export default Output;
